  render(){
    return(
        <Fragment>
            <hr></hr>
            <Row>
                <Col span={18} push={6}>
                    <div style = {{paddingLeft: 200 }}>
                        <Meta
                            avatar={<Avatar size = {100} icon= "user" />}

                        />
                    </div>


                </Col>
                <Col span={6} pull={18}>
                <div> 1. </div>
